import React from 'react';
import './App.css';
import {Route} from 'react-router-dom'
import HomePage from './pages/homepage/homepage.components';

const HatsPage = () => (
 <div>
   <h1> HATS PAGE</h1>
 </div>
);


function App() {

  return (
    <div><HomePage />
    <Route exact={true} path='/' component='HomePage' /></div>
  );
}

export default App;
